fa61839f-7d7b-4742-a7c7-565a6dcefd13.text:
§ 14
1.	Treści, metody i formy weryfikacji efektów uczenia się oraz zasady i sposób ustalania oceny końcowej z przedmiotu zawarte są w karcie przedmiotu dostępnej za pośrednictwem systemu informatycznego Uczelni i obowiązują studenta oraz realizujących przedmiot nauczycieli akademickich. Aktualizacja zawartości karty przedmiotu dokonywana jest przed rozpoczęciem semestru, w którym przedmiot jest realizowany.
2.	Kierownik przedmiotu lub prowadzący zajęcia na pierwszych zajęciach z przedmiotu zobowiązany jest do omówienia karty przedmiotu oraz do sformułowania i udokumentowanego podania do wiadomości studentów:
1)	zasad odbywania zajęć dydaktycznych;
2)	warunków usprawiedliwiania i odrabiania nieobecności na zajęciach;
3)	warunków i trybu przystępowania i uzyskiwania zaliczenia zajęć;
4)	metod weryfikacji i warunków przeprowadzania sprawdzianów uzyskania efektów uczenia się;
5)	zasad ustalania ocen cząstkowych ze składowych form zajęć i oceny końcowej z przedmiotu;
6)	terminów konsultacji dostosowanych do formy studiów.
Zmiana warunków określonych w pkt 1, 2 i 3 w okresie realizacji przedmiotu może nastąpić w porozumieniu ze studentami których zmiany dotyczą.
3.	Przekroczenie limitu 20% nieusprawiedliwionych nieobecności na jednej z obowiązkowych form zajęć z przedmiotu, może być podstawą do niezaliczenia przedmiotu. Dla studentów pierwszego roku studiów pierwszego stopnia wszystkie formy zajęć są obowiązkowe. Dla lat wyższych studiów pierwszego stopnia oraz dla studiów drugiego stopnia obowiązkowe są ćwiczenia audytoryjne, zajęcia laboratoryjne, zajęcia projektowe, lektoraty, seminaria zajęcia praktyczne i terenowe. Student ma prawo usprawiedliwić swoją nieobecność u prowadzącego zajęcia w terminie do 14 dni od zakończenia okresu nieobecności, na podstawie zwolnienia lekarskiego lub innych dokumentów potwierdzających przyczynę nieobecności.
4.	Zaliczenia zajęć z przedmiotu dokonuje prowadzący zajęcia lub kierownik przedmiotu zgodnie z zasadami określonymi w karcie przedmiotu. W szczególności zaliczenie przedmiotu może mieć formę egzaminu.
5.	Egzamin jest sprawdzianem osiągniętych przez studenta efektów uczenia się określonych w karcie przedmiotu. Egzamin może być przeprowadzony w formie ustnej lub pisemnej, bądź przy zastosowaniu obu tych form. Wynik egzaminu może stanowić ocenę końcową z przedmiotu lub być częścią składową oceny końcowej przedmiotu, ustalanej zgodnie z zasadami określonymi w karcie przedmiotu.
6.	Egzamin kompetencyjny jest szczególną formą potwierdzenia osiągnięcia efektów uczenia się dotyczącą zagregowanych kierunkowych efektów uczenia się programu studiów. Egzamin kompetencyjny jest przeprowadzany w formie ustnej, która może być uzupełniona o formę pisemną. Egzamin przeprowadza powołana przez Prodziekana komisja. Wynik egzaminu kompetencyjnego staje się częścią oceny ze studiów, zgodnie z

