§ 13;
6)	zmiany kierunku i formy studiów oraz prawo wyboru i zmiany specjalności studiów, w zakresie możliwości techniczno-organizacyjnych oraz ekonomicznych Uczelni;
7)	otrzymywania pomocy materialnej, na zasadach określonych w odrębnych przepisach;
8)	ubiegania się o zakwaterowanie i zakwaterowanie swego małżonka lub dzieci w domu studenckim Uczelni;
9)	otrzymywania nagród i wyróżnień według zasad określonych w Uczelni w odrębnych przepisach;
10)	uczestniczenia w życiu społecznym i kulturalnym Uczelni;
11)	zrzeszania się w uczelnianych organizacjach studenckich, w szczególności w kołach naukowych oraz zespołach i klubach artystycznych i sportowych;
12)	przeszkolenia w zakresie praw i obowiązków studenta;
13)	posiadania ważnej legitymacji studenckiej;
14)	korzystania, w relacjach z władzami uczelni, ze wsparcia upoważnionych przez niego przedstawicieli Samorządu Studenckiego uczelni.
