131066eb-9634-4ed9-86da-f73939dbdec5.text:
§ 27
1.	Potrzeby wynikające z niepełnosprawności student zgłasza do Prodziekana oraz do Biura ds. Obsługi Osób Niepełnosprawnych PŁ najpóźniej w ciągu dwóch tygodni od rozpoczęcia semestru a w trakcie semestru, w ciągu dwóch tygodni od zaistnienia tych potrzeb.
2.	W zależności od rodzaju niepełnosprawności i możliwości techniczno-organizacyjnych Uczelnia stwarza studentowi niepełnosprawnemu odpowiednie warunki odbywania i zaliczania zajęć. W szczególności:
1)	na prośbę studenta, kierownik Biura ds. Obsługi Osób Niepełnosprawnych, wystawia „Opinię w sprawie dostosowania organizacji procesu dydaktycznego do potrzeb wynikających z niepełnosprawności studenta”. Określa się w niej ograniczenia studenta wynikające z jego niepełnosprawności i zawiera wskazania alternatywnych form realizacji procesu dydaktycznego. Prodziekan kieruje ww. opinię do osób prowadzących zajęcia dydaktyczne realizowane przez studenta;
2)	jeżeli niepełnosprawność studenta nie pozwala na udział w zajęciach na zasadach ogólnych, możliwe jest zwiększenie dopuszczalnej liczby godzin nieobecności studenta na obowiązkowych zajęciach;
3)	jeżeli stan zdrowia studenta uniemożliwia realizację planu studiów przewidzianego na dany rok albo semestr, Prodziekan na wniosek studenta i po uzyskaniu pisemnej opinii Biura ds. Obsługi Osób Niepełnosprawnych PŁ może ustalić dla studenta indywidualną organizację studiów polegającą na indywidualnej organizacji zajęć (IOZ) lub udzielić urlop od zajęć;
4)	w zajęciach i zaliczeniach przedmiotów mogą uczestniczyć na podstawie opinii Biura ds. Obsługi Osób Niepełnosprawnych PŁ i za zgodą Prodziekana asystenci osób niepełnosprawnych, w tym tłumacze języka migowego, lektorzy, stenotypiści i asystenci laboratoryjni;
5)	w przypadku, gdy z powodu niepełnosprawności studenta niemożliwe jest samodzielne sporządzanie notatek Prodziekan, po zasięgnięciu opinii Biura ds. Obsługi Osób Niepełnosprawnych, udziela pozwolenia na zastosowanie dodatkowych urządzeń technicznych i wykonywanie notatek poprzez rejestrowanie dźwięku i obrazu. W przypadku stosowania urządzeń rejestrujących dźwięk i obraz, student zobowiązany jest do uprzedniego podpisania deklaracji o ochronie praw autorskich i wykorzystaniu zarejestrowanych materiałów wyłącznie na użytek prywatny w myśl art. 23 Ustawy z dnia 4 lutego 1994 r. o prawie autorskim i prawach pokrewnych (tj. Dz. U. z 2018 r. poz. 1191, z późn. zm.);
6)	w indywidualnych przypadkach dotyczących egzaminów, lub innych form weryfikacji efektów uczenia się dopuszcza się dostosowanie formy weryfikacji do specjalnych potrzeb wynikających z niepełnosprawności studenta.
