6.	Studenta, który posiada ponowną rejestrację na ten sam semestr lub rok nie obowiązuje uzyskiwanie zaliczeń i zdawanie egzaminów z przedmiotów uprzednio zaliczonych. W przypadku wystąpienia zmian programowych dotyczących efektów uczenia się, Prodziekan, na wniosek studenta złożony w ciągu 14 dni od rozpoczęcia semestru, może podjąć decyzję o uznaniu przedmiotów już zaliczonych jako równoważnych. 
7.	Student, który nie uzyskał zaliczenia z danego przedmiotu i zgodnie z decyzją Prodziekana został skierowany na powtarzanie przedmiotu, jest zobowiązany do uczestniczenia i powtórnego zaliczania wszystkich form tego przedmiotu. Na wniosek studenta kierownik przedmiotu jest uprawniony do zwolnienia studenta powtarzającego przedmiot z obowiązku powtórnego zaliczania tych części przedmiotu, które uprzednio zaliczył.
8.	W przypadku przedmiotów zaliczonych na innym kierunku studiów lub poza Uczelnią, w tym również na uczelni zagranicznej:
1)	punkty ECTS uznaje się bez ponownej weryfikacji uzyskania efektów uczenia się, jeżeli kształcenie odbywało się zgodnie z porozumieniem zawartym pomiędzy uczelniami;
2)	punkty ECTS mogą zostać uznane w miejsce przedmiotów określonych w programie studiów w przypadku stwierdzenia zgodności uzyskanych efektów uczenia się;
3)	w przypadku zmiany kierunku studiów student otrzymuje na nowym kierunku taką liczbę punktów ECTS za zaliczone na poprzednim kierunku zajęcia i praktyki, jaka jest przypisana efektom uczenia się uzyskiwanym w wyniku realizacji odpowiednich zajęć i praktyk na nowym kierunku;
4)	decyzję o zaliczeniu (przeniesieniu) przedmiotów, ocen i punktów ECTS podejmuje Prodziekan, na wniosek studenta, na podstawie przedstawionej przez studenta dokumentacji odbytego przebiegu studiów.

