c86089a0-b139-42d7-ba9b-840d821f5930.text:
§ 2
Użyte w regulaminie określenia oznaczają:
1)	Ustawa – ustawa z dnia 20 lipca 2018 r. – Prawo o szkolnictwie wyższym i nauce (Dz. U. z 2018 r. poz. 1668, z późn. zm.);
2)	Uczelnia – Politechnika Łódzka;
3)	Statut – Statut Politechniki Łódzkiej;
4)	Rektor – Rektor Politechniki Łódzkiej;
5)	Prorektor – prorektor właściwy ds. studenckich - osoba pełniąca funkcje kierownicze, o których mowa w art. 23 ust. 5 zd. 1 Ustawy;
6)	Prodziekan – prodziekan właściwy ds. studenckich - osoba odpowiedzialna za organizację i nadzór nad realizacją kształcenia w jednostce organizacyjnej uczelni i upoważniona przez Rektora do podejmowania rozstrzygnięć w indywidualnych sprawach studenta związanych z przebiegiem studiów;
7)	wydział – jednostka organizacyjna określona w statucie, realizująca kształcenie na co najmniej jednym kierunku studiów;
8)	efekty uczenia się – wiedza, umiejętności oraz kompetencje społeczne nabyte w procesie uczenia się;
9)	punkt ECTS – określa nakład pracy studenta, wymagany przy realizacji programu studiów, powiązany z efektami uczenia się; ECTS (European Credit Transfer and Accumulation System) – europejski system transferu i akumulacji punktów zaliczeniowych, służący do oceny postępów studenta w zdobywaniu wiedzy i umiejętności oraz do potwierdzania realizacji kolejnych etapów kształcenia;
10)	forma studiów – studia stacjonarne, studia niestacjonarne;
11)	program studiów – określa: efekty uczenia się, opis procesu prowadzącego do uzyskania efektów uczenia się, liczbę punktów ECTS przypisanych przedmiotom, praktyki zawodowe;
12)	plan studiów – harmonogram realizacji programu studiów w poszczególnych semestrach i latach cyklu kształcenia; 
13)	tok studiów – realizowany przez studenta program studiów i plan studiów;
14)	plan zajęć – szczegółowy harmonogram realizacji zajęć w danym semestrze danego roku akademickiego;
15)	rok akademicki – okres kalendarzowy, w którym prowadzone są zajęcia oraz egzaminy i zaliczenia przewidziane w planie studiów i programie studiów;
16)	semestr letni/zimowy – okres kalendarzowy obejmujący część roku akademickiego;
17)	rok studiów – jednostka rozliczeniowa realizacji programu studiów;
18)	semestr studiów – okres rozliczeniowy dla oceny postępów studenta w nauce;
19)	przedmiot – grupa zajęć złożona z jednego rodzaju zajęć lub różnych zajęć składowych prowadzonych pod wspólną nazwą, z unikalnym kodem w systemie informatycznym uczelni, z określonymi efektami uczenia się i przypisaną liczbą punktów ECTS, realizowanych w danym semestrze planu studiów i podlegający łącznej ocenie;
20)	karta przedmiotu – dokument definiujący przedmiot, określający min. formy i liczby godzin zajęć, liczbę przypisanych punktów ECTS, cele przedmiotu i zakładane przedmiotowe efekty uczenia się, treści kształcenia, metody weryfikacji efektów uczenia się, zasady ustalania oceny końcowej;
21)	kierownik przedmiotu – osoba odpowiedzialna za program przedmiotu i jego realizację, upoważniona do dokonywania zmian w karcie przedmiotu i wyników zaliczeń studentów w dokumentacji przebiegu studiów;
22)	prowadzący zajęcia z przedmiotu – nauczyciel akademicki lub inna upoważniona osoba, która realizuje dane zajęcia z przedmiotu;
23)	zaliczenie zajęć – zakończona wystawieniem oceny czynność sprawdzenia osiągnięcia efektów uczenia się przewidzianych dla danej formy realizacji przedmiotu;
24)	egzamin – ustny, pisemny lub zawierający obie ww. formy sprawdzian osiągnięcia efektów uczenia się obejmujący zakres jednej lub więcej form zajęć z przedmiotu;
25)	zaliczenie przedmiotu – uzyskanie pozytywnej łącznej oceny końcowej z przedmiotu;
26)	przedmiot zaliczony – przedmiot z ustaloną i zarejestrowaną w systemie informatycznym uczelni pozytywną, łączną oceną końcową;
27)	powtarzanie przedmiotu z powodu niezadowalających wyników w nauce – obowiązek zaliczenia przedmiotu objętego planem studiów, z którego student we wcześniejszym cyklu nie uzyskał oceny pozytywnej;
28)	rejestracja – rozstrzygnięcie określające status studenta w kolejnym roku studiów.

