43e4b939-d747-4962-b337-3d9e413633d8.text:
§ 35
1.	Za postępowanie uchybiające godności studenta i za naruszanie przepisów obowiązujących w Politechnice Łódzkiej student ponosi odpowiedzialność dyscyplinarną.
2.	Karami dyscyplinarnymi są:
1)	upomnienie; 
2)	nagana; 
3)	nagana z ostrzeżeniem; 
4)	zawieszenie w określonych prawach studenta na okres do 1 roku; 
5)	wydalenie z uczelni.
3.	Kary dyscyplinarne dokumentowane są w formie pisemnej i rejestrowane w systemie informatycznym Uczelni.
4.	Szczegółowy tryb postępowania wyjaśniającego i postępowania dyscyplinarnego w sprawach studentów, a także sposób wykonywania kar dyscyplinarnych i ich zatarcia określają odrębne przepisy.
