§ 18
1.	W Politechnice Łódzkiej stosuje się następującą skalę ocen:
1)	pięć – 5,0;
2)	cztery i pół – 4,5;
3)	cztery – 4,0;
4)	trzy i pół – 3,5;
5)	trzy – 3,0;
6)	dwa – 2,0 .
Najniższą i jedyną niezaliczającą oceną jest ocena dwa – 2,0.
2.	Zajęcia z wychowania fizycznego są zaliczane wpisem „zal”, który nie ma odpowiednika w ocenie liczbowej i nie jest uwzględniany przy obliczaniu oceny średniej.
3.	Praktyki mogą być zaliczane wpisem „zal” lub na ocenę liczbową, zgodnie z programem studiów.
4.	Status złożenia pracy dyplomowej odnotowywany jest w systemie informatycznym wpisem „zal”.
5.	Ocenę średnią za dany okres studiów oblicza się jako średnią ważoną ocen z przedmiotów zaliczonych w danym okresie studiów. Wagę stanowi liczba punktów przypisanych danemu przedmiotowi, odniesiona do sumy punktów wszystkich przedmiotów zaliczonych w danym okresie studiów. Przy wyznaczaniu średniej ważonej nie bierze się pod uwagę przedmiotów, które zostały zaliczone wpisem „zal” oraz oceny z egzaminu kompetencyjnego, o którym mowa w

0d198688-7142-4919-ad64-57933ff62bd7.text:
§ 40
1.	Student, w terminie 21 dni od spełnienia warunku uzyskania wszystkich zaliczeń i liczby punktów ECTS wynikającej z programu studiów, w tym złożenia pracy dyplomowej, zobowiązany jest uregulować wszystkie zobowiązania wobec Uczelni i złożyć do Prodziekana wniosek o dopuszczenie do egzaminu dyplomowego wraz z kompletem dokumentów wymaganych przez wewnętrzne zasady dyplomowania obowiązujące na wydziale.
2.	Prodziekan po stwierdzeniu:
1)	uzyskania przez studenta wszystkich przewidzianych programem studiów zaliczeń w tym praktyk zawodowych;
2)	skutecznego złożenia pracy dyplomowej w terminie;
3)	pozytywnego potwierdzenia oryginalności pracy dyplomowej z wykorzystaniem Jednolitego Systemu Antyplagiatowego, o którym mowa w art. 351 ust. 1 ustawy z dnia 20 lipca 2018 r. – Prawo o szkolnictwie wyższym i nauce (Dz. U. 2018, poz. 1668, z późn. zm.); tryb sprawdzania i potwierdzania oryginalności prac dyplomowych określony jest w odrębnych przepisach;
4)	uzyskania pozytywnych ocen za pracę dyplomową wystawionych przez promotora pracy i recenzenta;
5)	spełnienia przez studenta innych indywidualnych warunków ustalonych przez Prodziekana w przebiegu studiów i uregulowania przez studenta wszystkich zobowiązań wobec Uczelni,
wydaje w ciągu 14 dni decyzję o dopuszczeniu studenta do egzaminu dyplomowego i wyznacza jego termin.
3.	W przypadku niezłożenia przez studenta na warunkach i w terminie opisanych w ust. 1 i 2 wniosku o dopuszczenie do egzaminu dyplomowego, Prodziekan ma prawo wyznaczyć termin egzaminu dyplomowego z własnej inicjatywy.
