§ 7
1.	Do obowiązków studenta należy:
1)	postępowanie zgodnie z treścią ślubowania akademickiego i Regulaminem Studiów;
2)	przestrzeganie przepisów obowiązujących w Uczelni;
3)	odbywanie studiów zgodnie z programem studiów i planem zajęć, w szczególności uczestniczenie w zajęciach dydaktycznych i organizacyjnych, uzyskiwanie zaliczeń i składanie egzaminów, odbywanie praktyk i realizowanie innych zadań wynikających z programu studiów;
4)	odbywanie wymaganych odrębnymi przepisami szkoleń z zakresu bhp;
5)	uzyskanie, w przypadku otrzymania skierowania wystawionego przez właściwe władze uczelni, orzeczenia lekarskiego, stwierdzającego brak przeciwwskazań do realizacji studiów na wybranym kierunku, na którym w trakcie studiów student będzie narażony na działanie czynników szkodliwych, uciążliwych lub niebezpiecznych dla zdrowia;
6)	poszanowanie mienia Uczelni;
7)	przestrzeganie przepisów dotyczących prawa własności intelektualnej;
8)	korzystanie z funkcji, dokumentów i informacji udostępnianych studentowi przez system informatyczny Uczelni, w szczególności terminowe weryfikowanie zarejestrowanego w systemie stanu indywidualnych zobowiązań finansowych studenta, wyników końcowych przedmiotów obowiązujących go w danym semestrze oraz statusu rejestracji;
9)	korzystanie z Systemu Poczty Elektronicznej Uczelni, który jest podstawowym środkiem komunikacji pomiędzy studentem i administracją uczelni w sprawach przebiegu studiów, w tym codzienne sprawdzenie indywidualnej skrzynki poczty elektronicznej. Informacje przekazywane przez administrację uczelni do studenta poprzez ten system są dla studenta wiążące.
2.	Student jest zobowiązany do terminowego wnoszenia opłat związanych z odbywaniem studiów oraz opłat za usługi edukacyjne, jeżeli takie opłaty przewidziane są w odrębnych przepisach. Niewniesienie ww. opłat może skutkować skreśleniem z listy studentów.
3.	Warunki pobierania opłat związanych z odbywaniem studiów określa umowa zawierana między Uczelnią a studentem. Umowa jest zawierana nie później niż w terminie trzydziestu dni od rozpoczęcia zajęć. 
4.	Student ma obowiązek niezwłocznie, pisemnie powiadomić właściwego Prodziekana o wszelkich okolicznościach mających negatywny wpływ na wypełnianie przez niego obowiązków nałożonych przez regulamin studiów i inne przepisy obowiązujące w uczelni.
5.	Student ma obowiązek niezwłocznie, pisemnie powiadomić właściwego Prodziekana o zmianach dotyczących nazwiska, adresu oraz o zmianach okoliczności mających wpływ na zakres i wysokość przyznanej pomocy materialnej.
6.	Studentowi będącemu pod wpływem alkoholu, narkotyków lub podobnie działających środków psychoaktywnych nie wolno uczestniczyć w zajęciach pod rygorem skierowania wniosku o wszczęcie postępowania dyscyplinarnego i wymierzenia kar dyscyplinarnych przewidzianych przepisami.

f322ac3e-1b11-4c3b-bbf3-a718d1ac867a.text:
§ 28
1.	Student otrzymuje urlop od zajęć w postaci urlopu krótkoterminowego lub urlopu długoterminowego.
2.	Jednorazowo urlopu krótkoterminowego udziela się na okres nie dłuższy niż jeden rok – dwa semestry zajęć.
3.	Urlopu długoterminowego udziela się na okres dłuższy niż jeden rok (dwa semestry zajęć), ale nie dłuższy niż dwa lata (cztery semestry zajęć).
4.	Urlop krótkoterminowy można otrzymać w formie urlopu:
1)	dziekańskiego – wynikającego z toku studiów;
2)	zdrowotnego – w przypadku długotrwałej niezdolności do realizacji studiów potwierdzonej orzeczeniem komisji lekarskiej;
3)	zdrowotnego dla studentki w ciąży – urlopu udziela się na okres do dnia urodzenia dziecka;
4)	wychowawczego – przysługującego rodzicowi w okresie do jednego roku od dnia urodzenia dziecka, z tym że jeżeli koniec urlopu przypada w trakcie semestru zajęć, urlop może być przedłużony do końca tego semestru;
5)	zawodowego – przeznaczonego w szczególności na kształcenie poza granicami kraju lub realizację stażu zawodowego lub praktyk zawodowych realizowanych w ramach programów międzynarodowych;
6)	okolicznościowego – udzielanego z powodu udokumentowanych, ważnych okoliczności losowych.
5.	Urlopu krótkoterminowego, za wyjątkiem urlopu dziekańskiego, udziela Prodziekan na pisemny wniosek studenta złożony najpóźniej w ciągu 14 dni od zaistnienia przyczyny stanowiącej podstawę do jego udzielenia, za wyjątkiem urlopu zdrowotnego dla studentki w ciąży, którego można udzielić w dowolnym okresie ciąży.
6.	Urlop krótkoterminowy w formie urlopu zawodowego można uzyskać łącznie na okres jednego roku na danym poziomie i programie studiów.
7.	Na urlop dziekański kieruje Prodziekan z własnej inicjatywy.
8.	W okresie urlopów krótkoterminowych, z wyjątkiem urlopu zdrowotnego określonego w ust. 4 pkt 2 powyżej, student zachowuje możliwość przystąpienia do weryfikacji uzyskanych efektów uczenia się z nie zaliczonych przedmiotów w terminach określonych w harmonogramie roku akademickiego.
9.	W okresie urlopów krótkoterminowych z wyjątkiem urlopu zdrowotnego określonego w ust. 4 pkt 2 powyżej, student może za zgodą Prodziekana powtarzać niezaliczone wcześniej przedmioty. W takim przypadku student wnosi opłaty za powtarzanie przedmiotów zgodnie z zasadami ustalonymi przez Uczelnię, o których mowa w
